import { FiUsers } from "react-icons/fi";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
`;

const DataStatus = ({ data }) => (
  <>
    <FiUsers />
    DataSet loaded {data.length}
  </>
);

export default DataStatus;
